import React from 'react'
import { StyleSheet, Button, Text, TouchableHighlightBase, View } from 'react-native'

interface Props {
    icon: string,
    onClick: () => void,
}

const Buttons: React.FC<Props> = (props) => {
    return (
        <View>
            <Text>
                test
            </Text>
            <TouchableHighlightBase onPress={props.onClick} >

            </TouchableHighlightBase>
        </View>
    )
}


const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
});

export default Buttons
